import React,{useState, useEffect} from "react";
import NextCard from "../NextCard";
import { Section } from "./styles";
import getUpcomingLaunches from "../../services/getUpcomingLaunches";


const NextLayout = () => {

  const [upcominglaunches, setupcominglaunches] = useState([]);

  useEffect(() => {
    getUpcomingLaunches().then((data) => setupcominglaunches(data));
  }, []);

  console.log(upcominglaunches);
  return (
    <Section>
    {
      upcominglaunches.map((item)=>{
        return(
          <NextCard key={item.id} name={item.name} details={item.details} image={item.links.patch.large} date={item.date_local} />
        )

      })
    }
    </Section>
  );
};

export default NextLayout;
